 - Indian History | Mocomi Kids\\n01:39  Persian and Greek Invaders | Mocomi Kids\\n03:12  Chola Empire History | Mocomi Kids\\n07:17  Mauryans - Maurya Dynasty History | Mocomi Kids\\n09:54  Ashoka the Great - Kings of India | Mocomi Kids\\n12:51  Chera Dynasty - Kingdoms of South India | Mocomi Kids\\n15:01  Pallavas - Pallava Dynasty History | Mocomi Kids\\n18:43  Harshavardhana - Kings of India | Mocomi Kids\\n21:14  Rajput Warriors - Son of King - History India | Mocomi Kids \\n24:10  Early Mughals in India | Mocomi Kids\\n28:42  Akbar the Great Mughal Emperor - History India | Mocomi Kids\\n32:18  Aurangzeb - Mughal Emperor - History India | Mocomi Kids \\n37:08  Shivaji Maharaj - Kings of India | Mocomi Kids\\n41:11  Hyder Ali - Kings of India | Mocomi Kids \\n44:15  Tipu Sultan - Kings of India | Mocomi Kids\\n47:11  Jhansi Ki Rani Laxmibai and Her Story | Mocomi Kids\\n\\n#DynastiesofIndia #Video #History\\n\\nFor more fun learning history videos, go to : https:\/\/mocomi.com\/learn\/history\/\\n\\nWatch more History of India videos in one go here https:\/\/www.youtube.com\/watch?v=KhDY4KJuvc0\\u0026list=PL6vCwGtCTVtMe7peK8PBzTGUO-H_XXGc6\\n\\nSubscribe here for new and interesting content every week   https:\/\/www.youtube.com\/mocomikids?sub_confirmation=1\\n\\nPress Bell Icon ; For Latest Updates. \\nThanks for watching! Don't forget to give us a Thumbs Up !\\n\\nFollow Mocomi Kids - Top educational website for kids,\\n\\non Facebook https:\/\/www.facebook.com\/mocomikids\/\\non Twitter https:\/\/twitter.com\/MocomiKids\\non Pinterest https:\/\/www.pinterest.com\/mocomikids\/\\non Instagram - https:\/\/www.instagram.com\/mocomikids\/\\non LinkedIn https:\/\/www.linkedin.com\/company\/mocomi-kids\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Ihd3uh6jUqo\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLATaxLP_Q6IM2PJFkxPAFMuHHNTYg\",\"width\":168,\"height\":94},{\"url\" ans and had great Kings like Chandragupta Maurya and Asoka the Great, The Chera Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\\n\\n00:01  Pandya Dynasty - Indian History | Mocomi Kids\\n01:39  Persian and Greek Invaders | Mocomi Kids\\n03:12  Chola Empire History | Mocomi Kids\\n07:17  Mauryans - Maurya Dynasty History | Mocomi Kids\\n09:54  Ashoka the Great - Kings of India | Mocomi Kids\\n12:51  Chera Dynasty - Kingdoms of South India | Mocomi Kids\\n15:01  Pallavas - Pallava Dynasty History | Mocomi Kids\\n18:43  Harshavardhana - Kings of India | Mocomi Kids\\n21:14  Rajput Warriors - Son of King - History India | Mocomi Kids \\n24:10  Early Mughals in India | Mocomi Kids\\n28:42  Akbar the Great Mughal Emperor - History India | Mocomi Kids\\n32:18  Aurangzeb - Mughal Emperor - History India | Mocomi Kids \\n37:08  Shivaji Maharaj - Kings of India | Mocomi Kids\\n41:11  Hyder Ali - Kings of India | Mocomi Kids \\n44:15  Tipu Sultan - Kings of India | Mocomi Kids\\n47:11  Jhansi Ki Rani Laxmibai and Her Story | Mocomi Kids\\n\\n#DynastiesofIndia #Video #History\\n\\nFor more fun learning history videos, go to : https:\/\/mocomi.com\/learn\/history\/\\n\\nWatch more History of India videos in one go here https:\/\/www.youtube.com\/watch?v=KhDY4KJuvc0\\u0026list=PL6vCwGtCTVtMe7peK8PBzTGUO-H_XXGc6\\n\\nSubscribe here for new and interesting content every week   https:\/\/www.youtube.com\/mocomikids?sub_confirmation=1\\n\\nPress Bell Icon ; For Latest Updates. \\nThanks for watching! Don't forget to give us a Thumbs Up !\\n\\nFollow Mocomi Kids - Top educational website for kids,\\n\\non Facebook https:\/\/www.facebook.com\/mocomikids\/\\non Twitter https:\/\/twitter.com\/MocomiKids\\non Pinterest https:\/\/www.pinterest.com\/mocomikids\/\\non Instagram - https:\/\/www.instagram.com\/mocomikids\/  Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\n\n"},{"text":"00:01","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwixj6zmsJLqAhVagHsKHc0iBVk=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=1s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":1}}},{"text":"  Pandya Dynasty - Indian History | Mocomi Kids\n"},{"text":"01:39","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwixj6zmsJLqAhVagHsKHc0iBVk=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=99s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":99}}},{"text":"  Persian and Greek Invaders | Mocomi Kids\n"},{"text":"03:12","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwixj6zmsJLqAhVagHsKHc0iBVk=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=192s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":192}}},{"text":"  Chola Empire History | Mocomi Kids\n"},{"text":"07:17","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwixj6zmsJLqAhVagHsKHc0iBVk=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=437s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":437}}},{"text":"  Mauryans - Maurya Dynasty History | Mocomi Kids\n"},{"text":"09:54","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwixj6zmsJLqAhVagHsKHc0iBVk=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=594s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}}  countries, Arab countries,  and Chinese territories.\n\nFrom the late Bronze Age to the Revolt of 1857 and India's Struggle for Freedom, this compilation gives you a rare glimpse into history. Watch them come alive!\n\nThe Tamil Dynasty of the Pandyas, who ruled first from Korkai near present day Tuticorin, before shifting to Madurai, from as early as 600 BC BC had a thriving shipping and trading with Greece and Rome to the Greek and Persian invasions from land and sea. To the massive Chola Empire that spread to the neighbouring countries of South East Asia, The Mauryas in Northern India who conquered most of India except the Tamilians and had great Kings like Chandragupta Maurya and Asoka the Great, The Chera Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\n\n00:01  Pandya Dynasty - Indian History | Mocomi Kids\n01:39  Persian and Greek Invaders | Mocomi Kids\n03:12  Chola Empire History | Mocomi Kids\n07:17  Mauryans - Maurya Dynasty History | Mocomi Kids\n09:54  Ashoka the Great - Kings of India | Mocomi Kids\n12:51  Chera Dynasty - Kingdoms of South India | Mocomi Kids\n15:01  Pallavas - Pallava Dynasty History | Mocomi Kids\n18:43  Harshavardhana - Kings of India | Mocomi Kids\n21:14  Rajput Warriors - Son of King - History India | Mocomi Kids \n24:10  Early Mughals in India | Mocomi Kids\n28:42  Akbar the Great Mughal Emperor - History India | Mocomi Kids\n32:18  Aurangzeb - Mughal Emperor - History India | Mocomi Kids \n37:08  Shivaji Maharaj - Kings of India | Mocomi Kids\n41:11  Hyder Ali - Kings of India | Mocomi Kids \n44:15  Tipu Sultan - Kings of India | Mocomi Kids\n47:11  Jhansi Ki Rani Laxmibai and Her Story | Mocomi Kids\n\n#DynastiesofIndia #Video #History\n\nFor more fun learning history videos, go to : https://mocomi.com/learn/history/\n\nWatch more History of India videos in ies, Arab countries,  and Chinese territories.\n\nFrom the late Bronze Age to the Revolt of 1857 and India's Struggle for Freedom, this compilation gives you a rare glimpse into history. Watch them come alive!\n\nThe Tamil Dynasty of the Pandyas, who ruled first from Korkai near present day Tuticorin, before shifting to Madurai, from as early as 600 BC BC had a thriving shipping and trading with Greece and Rome to the Greek and Persian invasions from land and sea. To the massive Chola Empire that spread to the neighbouring countries of South East Asia, The Mauryas in Northern India who conquered most of India except the Tamilians and had great Kings like Chandragupta Maurya and Asoka the Great, The Chera Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\n\n00:01  Pandya Dynasty - Indian History | Mocomi Kids\n01:39  Persian and Greek Invaders | Mocomi Kids\n03:12  Chola Empire History | Mocomi Kids\n07:17  Mauryans - Maurya Dynasty History | Mocomi Kids\n09:54  Ashoka the Great - Kings of India | Mocomi Kids\n12:51  Chera Dynasty - Kingdoms of South India | Mocomi Kids\n15:01  Pallavas - Pallava Dynasty History | Mocomi Kids\n18:43  Harshavardhana - Kings of India | Mocomi Kids\n21:14  Rajput Warriors - Son of King - History India | Mocomi Kids \n24:10  Early Mughals in India | Mocomi Kids\n28:42  Akbar the Great Mughal Emperor - History India | Mocomi Kids\n32:18  Aurangzeb - Mughal Emperor - History India | Mocomi Kids \n37:08  Shivaji Maharaj - Kings of India | Mocomi Kids\n41:11  Hyder Ali - Kings of India | Mocomi Kids \n44:15  Tipu Sultan - Kings of India | Mocomi Kids\n47:11  Jhansi Ki Rani Laxmibai and Her Story | Mocomi Kids\n\n#DynastiesofIndia #Video #History\n\nFor more fun learning history videos, go to : https://mocomi.com/learn/history/\n\nWatch more History of India videos in one go
